script: |
  super -f text -I q6376.spq | sort > q6376.out

inputs:
  - name: q6376.spq
    data: |
      SELECT ALL + - 62 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 IN ( col0, col2 / + 50 + - + CAST ( + + col0 AS INTEGER ) );
  - name: tab2

outputs:
  - name: q6376.out
    data: |
      -62
      -62
      -62
